import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper-bundle.min.css";
import profilePic1 from "../../img/profile1.jpg";
import profilePic2 from "../../img/profile2.jpg";
import profilePic3 from "../../img/profile3.jpg";
import profilePic4 from "../../img/profile4.jpg";

const Reviews = () => {
  const clients = [
    {
      img: profilePic1,
      review:
        "Lorem ipsum dolor, sit at the front of view. Deep has exclent abilities to work as a react js developer",
    },
    {
      img: profilePic2,
      review:
        "Lorem ipsum dolor, sit at the front of view. Deep has exclent abilities to work as a react js developer",
    },
    {
      img: profilePic3,
      review:
        "Lorem ipsum dolor, sit at the front of view. Deep has exclent abilities to work as a react js developer",
    },
    {
      img: profilePic4,
      review:
        "Lorem ipsum dolor, sit at the front of view. Deep has exclent abilities to work as a react js developer",
    },
  ];
  return (
    <>
      <div className="t-wrapper">
        <div className="t-heading">
          <span>Clients always get</span>
          <span>Exceptional Work</span>
          <span>from me....</span>
          <div className="blur t-blur-1"></div>
          <div className="blur t-blur-2"></div>
        </div>
        {/* swipper */}
        <Swiper>{clients.map((clients, key))}</Swiper>
      </div>
    </>
  );
};

export default Reviews;
